import {useState} from 'react';


const StatsDisplay = ({stats}) => {
    console.log(stats);
    const [currency,setCurrency] = useState('standard');

    return (
        <div>
          <ul>
              <li>
                  {stats[currency][0].firstName +
                      stats[currency][0].lastName}
              </li>
          </ul>
        </div>
    );
};
export default StatsDisplay;
